import React from "react";
import styled from "styled-components";

import "../../App.css";
import logo from "../../assets/logo.png";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  flex:"1",
  min-width: 300px;
  justify-content: flex-end;
`;

const SelectScreen = styled.div`
  height: 100px;
  width: "80%";
  background-color: #000;
`;

const Logo = styled.p`
  font-size: 40px;
  font-weight: bold;
  text-align: center;
  color: white;
  margin-top:"40%"
`;

const TextInput = styled.input`
  height: 40px;
  padding: 0 10px;
  width: "60%";
  margin: 10px;
  border-radius: 23px;
`;

const LoginButton = styled.button`
  background: #891c1a;
  border-radius: 23px;
  border: none;
  color: white;
  height: 45px;
  padding: 0 10px;
  margin: 0 10px;
  margin-top: 40px;
`;

export default function Login() {
  return (
    <Container>
      <SelectScreen></SelectScreen>
      <Logo>iHelp</Logo>
      <TextInput></TextInput>
      <TextInput type="password"></TextInput>

      <LoginButton>I'm purple.</LoginButton>
    </Container>
  );
}
